@iqthon.on(admin_cmd(pattern="ÿ±ÿ≥ŸÖ ŸÇŸÑŸàÿ®(?:\s|$)([\s\S]*)"))  
async def itachi(event):
    "To get emoji art text."
    args = event.pattern_match.group(1)
    get = await event.get_reply_message()
    if not args and get:
        args = get.text
    if not args:
        await edit_or_reply(
            event, "**‚åîÔ∏ô ŸÇŸÖ ÿ®ŸÉÿ™ÿßÿ®Ÿá ÿßŸÑŸÉŸÑŸÖŸá ÿ®ÿ¨ÿßŸÜÿ® ÿßŸÑÿßŸÖÿ± **"
        )
        return
    result = ""
    for a in args:
        a = a.lower()
        if a in emojify.kakashitext:
            char = emojify.kakashiemoji[emojify.kakashitext.index(a)]
            result += char
        else:
            result += a
    await edit_or_reply(event, result)

@iqthon.on(admin_cmd(pattern="ÿ±ÿ≥ŸÖ ÿ¥ÿπÿßÿ±(?:\s|$)([\s\S]*)"))  
async def itachi(event):
    "To get custom emoji art text."
    args = event.pattern_match.group(1)
