@iqthon.on(admin_cmd(pattern="ŸÜÿµ ÿ´ÿ±Ÿä ÿØŸä(?:\s|$)([\s\S]*)"))    
async def figlet(event):
    "Changes the given text into the given style"
    input_str = event.pattern_match.group(1)
    if ";" in input_str:
        cmd, text = input_str.split(";", maxsplit=1)
    elif input_str is not None:
        cmd = None
        text = input_str
    else:
        await edit_or_reply(event, "**‚åîÔ∏ôŸÇŸÖ ÿ®ÿ•ÿπÿ∑ŸÄÿßÿ° ŸÜŸÄÿµ ŸÑÿ™ÿ∫ŸäŸäŸÄÿ±Ÿá ‚ê•**")
        return
    style = cmd
    text = text.strip()
    if style is not None:
        try:
            font = CMD_FIG[style.strip()]
        except KeyError:
            return await edit_delete(
                event, "**‚åîÔ∏ôÿ™ŸÖ ÿ™ÿ≠ÿØŸäŸÄÿØ ŸÜŸÖŸÄÿ∑ ÿ∫ŸäŸÄÿ± ÿµÿßŸÑŸÄÿ≠ ‚ö†Ô∏è**"
            )
        result = pyfiglet.figlet_format(deEmojify(text), font=font)
    else:
        result = pyfiglet.figlet_format(deEmojify(text))
    await edit_or_reply(event, result, parse_mode=_format.parse_pre)

@iqthon.on(admin_cmd(pattern="ŸÖŸÑÿµŸÇ ŸÖÿ™ÿ≠ÿ±ŸÉ(?: |$)(.*)"))
async def honkasays(event):
    await event.edit("`Sedang Memproses, Mohon Tunggu Sebentar...`")
    text = event.pattern_match.group(1)
    if not text:
        return await event.edit("Beri Aku Bebeberapa Text, Contoh : `.honka space <text>`")
    try:
        if not text.endswith("."):
            text = text + "."
        if len(text) <= 9:
            results = await bot.inline_query("honka_says_bot", text)
            await results[2].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        elif len(text) >= 14:
            results = await bot.inline_query("honka_says_bot", text)
            await results[0].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        else:
            results = await bot.inline_query("honka_says_bot", text)
            await results[1].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        await event.delete()
    except ChatSendInlineForbiddenError:
        await event.edit("`Mohon Maaf, Saya Tidak Bisa Menggunakan Hal-Hal Sebaris Disini.`")
    except ChatSendStickersForbiddenError:
        await event.edit("Mohon Maaf, Tidak Bisa Mengirim Sticker Disini.")
